import React, { useState } from 'react'
import cabinet from '../img/cabinet.png'

const Cabinet = () => {
  const [isOpenCabinet,setIsOpenCabinet] = useState(false);
  return (
    <div>
      <div className='navigation-item'><img className='cabinet-ico' src={cabinet} alt="" /></div>
      <div className='openCart'>
        {isOpenCabinet && (<div className='shopCart'><CabinetPopUp /></div>)}
      </div>
    </div>

  )
}

export default Cabinet;
